import React from "react";
import NavButton from "./NavButton";

function NavHeader() : any{
    return (
        <div>
            <div>
                <NavButton title={'All Projects'} />
                <NavButton title={'Workflow'} />
            </div>

        </div>
    );

}

export default NavHeader
